import { Image, Col } from 'react-bootstrap';


function Welcome2() {
    return (
        <Col md={5} style={{ paddingBottom: 20 }}>
                <Image src={'/images/profile1.png'} style={{ width: '300px', height: '300px'}} />
              </Col>
    );

}
export default Welcome2;
